import React from 'react';
import styled from 'styled-components';
import './App.css';

const HomePage = styled.div`
  display: flex;
  flex-direction: column;
`;

const Header = styled.header`
  width: 100%;
  height: 80px;
  position: fixed;
  background: var(--color-white);
  z-index: 1000;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 20px;
`;

const Logo = styled.img`
  height: 60px;
  width: 60px;
  object-fit: cover;
`;

const Nav = styled.nav`
  display: flex;
  align-items: center;
  gap: var(--gap-xl);
`;

const NavItem = styled.a`
  text-decoration: none;
  color: var(--color-black);
  font-size: var(--font-size-base);
  font-family: var(--font-changa-one);
  font-weight: 400;
`;

const Button = styled.button`
  cursor: pointer;
  border: none;
  padding: var(--padding-sm) var(--padding-base);
  background: ${({ primary }) => primary
    ? 'linear-gradient(90deg, #1A2B51 0%, #EC8845 100%)'
    : 'var(--color-black)'
  };
  border-radius: var(--br-7xs);
  color: var(--color-white);
  font-size: var(--font-size-base);
  font-family: var(--font-khula);
  display: flex;
  align-items: center;
  justify-content: center;
`;

const HeroSection = styled.section`
  width: 100%;
  height: 300px;
  position: relative;
  margin-top: 80px;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;

const HeroImage = styled.img`
  width: 100%;
  height: 300px;
  object-fit: cover;
  position: absolute;
  top: 0;
  left: 0;
  z-index: -1;
`;

const HeroTitle = styled.h1`
  color: var(--color-white);
  font-size: 50px;
  font-family: var(--font-changa-one);
  font-weight: 400;
  text-align: center;
`;

const Section = styled.section`
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
  padding: var(--padding-base) var(--padding-sm);
  flex-wrap: wrap;
`;

const ExploreColleges = styled.div`
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: flex-start;
  gap: var(--gap-xl);
  flex-wrap: wrap;
`;

const Title = styled.h1`
  margin: 0;
  font-size: 2.5rem;
  font-family: var(--font-changa-one);
  flex-shrink: 0;
`;

const ProductImage = styled.img`
  loading: lazy;
  width: 100%;
`;

const ProductInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: var(--gap-xl);
`;

const ProductCard = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: var(--gap-xl);
  flex: 1;
  max-width: 300px; /* Limit the width to fit multiple cards in one line */
`;

const SearchSection = styled.section`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: var(--padding-base) 0;
`;

const SearchInput = styled.input`
  padding: var(--padding-sm);
  width: 100%;
  max-width: 500px;
  border: 1px solid var(--color-gray-100);
  border-radius: var(--br-7xs);
`;

const TestimonialsSection = styled.section`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: var(--padding-base);
`;

const Testimonial = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: var(--padding-base);
`;

const Avatar = styled.img`
  loading: lazy;
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin-right: var(--gap-xl);
`;

const TestimonialText = styled.div`
  display: flex;
  flex-direction: column;
`;

const TestimonialName = styled.span`
  font-weight: bold;
`;

const TestimonialCourse = styled.span`
  color: var(--color-gray-100);
`;

function App() {
  return (
    <HomePage>
      <Header>
        <Logo src="https://via.placeholder.com/60x60" alt="Logo" />
        <Nav>
          <NavItem href="#">Home</NavItem>
          <NavItem href="#">Spot round admission</NavItem>
          <NavItem href="#">College Predictor</NavItem>
          <NavItem href="#">Resources</NavItem>
          <NavItem href="#">Contact Us</NavItem>
        </Nav>
        <div style={{ display: 'flex', gap: '10px' }}>
          <Button primary>
            <span>Sign Up</span>
          </Button>
          <Button>
            <span>Login</span>
          </Button>
        </div>
      </Header>
      <HeroSection>
        <HeroImage src="https://via.placeholder.com/1280x300" alt="Hero Image" />
        <HeroTitle>Explore 1000+ colleges and universities<br />and choose what’s best for YOU</HeroTitle>
      </HeroSection>
      <Section>
        <ExploreColleges>
          <ProductCard>
            <ProductImage src="https://via.placeholder.com/300x200" alt="Product 1" />
            <Title>SPOT ROUND ADMISSION</Title>
            <p>Info about what the product does</p>
            <Button primary>
              <span>EXPLORE</span>
            </Button>
          </ProductCard>
          <ProductCard>
            <ProductImage src="https://via.placeholder.com/300x200" alt="Product 2" />
            <Title>COLLEGE PREDICTOR</Title>
            <p>Info about what the product does</p>
            <Button primary>
              <span>EXPLORE</span>
            </Button>
          </ProductCard>
          <ProductCard>
            <ProductImage src="https://via.placeholder.com/300x200" alt="Product 3" />
            <Title>SPOT ROUND ADMISSION</Title>
            <p>Info about what the product does</p>
            <Button primary>
              <span>EXPLORE</span>
            </Button>
          </ProductCard>
        </ExploreColleges>
      </Section>
      <ProductImage src="https://via.placeholder.com/1280x400" alt="Banner" />
      <SearchSection>
        <SearchInput placeholder="search for colleges, courses and more..." />
      </SearchSection>
      <TestimonialsSection>
        <Title>Words of Gratitude</Title>
        <Testimonial>
          <Avatar src="https://via.placeholder.com/50" alt="Avatar" />
          <TestimonialText>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse congue quam cursus metus maximus, in commodo leo consectetur. Aliquam erat volutpat. Nullam enim mauris, tincidunt eget nisi sed, sagittis mollis dolor. Morbi egestas neque</p>
            <TestimonialName>Student Name</TestimonialName>
            <TestimonialCourse>Course</TestimonialCourse>
          </TestimonialText>
        </Testimonial>
      </TestimonialsSection>
    </HomePage>
  );
}

export default App;
